// npm start
import { Login } from './Login';
import { Home } from './Home';
import { createBrowserRouter } from 'react-router-dom';

const App = createBrowserRouter([
  { path : "/", element : <Login onSubmit={handleLogin} />},
  { path : "/Home", element : <Home/>},
])

export default App;
